import React from 'react';

function Card() {
    return (

        <div className="row align-items-center">

            <div className="col-9">.col-9</div>
  <div className="col-12">.col-4 Since 9 + 4 = 13 &gt; 12, this 4-column-wide div gets wrapped onto a new line as one contiguous unit.</div>
  <div className="col-6">.col-6 Subsequent columns continue along the new line.</div>
        </div>

    )
}

export default Card;
